import React, { useState, useContext } from "react";
import "./Login.css";
import { useNavigate } from "react-router-dom";
import LinkButton from "../../components/LinkButton/LinkButton";

const Login = ({ dark }) => {
  const navigate = useNavigate();
  const backgroundColor = dark ? "#121212" : "#F2EEEE";
  const primary = dark ? "white" : "black";
  return (
    <div className="login-wrapper" style={{ backgroundColor: backgroundColor }}>
      <h1 style={{ color: primary }}> Welcome back!! </h1>
      <form className="form">
        <input
          className="input-field"
          type="text"
          name="email"
          placeholder="Email"
        />
        <br />
        <br />
        <input
          className="input-field"
          type="password"
          name="password"
          placeholder="Password"
        />
        <br />
        <br />
        <div
          className="btn"
        >
          <LinkButton path={"/login"} content={"Get Started"} primary={dark} />
        </div>
      </form>
    </div>
  );
};

export default Login;
